import "./App.css";
import axios from "axios";

const submitHandler = async (e) => {
  e.preventDefault();
  try {
    await axios.delete("http://localhost:3001/people/10", {}).then(
      (response) => {
        console.log(response);
      },
      (error) => {
        console.log(error);
      }
    );
  } catch (error) {
    console.log(error);
  }
};

function App() {
  return (
    <div className="App">
      <form>
        <table>
          <tbody>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Age</th>
              <th>Talent</th>
            </tr>
            <tr>
              <td>
                <input
                  className="firstName"
                  type="text"
                  placeholder="First Name"
                />
              </td>
              <td>
                <input className="lastName" placeholder="Last Name" />
              </td>
              <td>
                <input className="age" placeholder="Age" />
              </td>
              <td>
                <input className="talent" placeholder="Talent" />
              </td>
            </tr>
          </tbody>
        </table>
        <br></br>
        <div>
          <button className="button1" onClick={submitHandler} type="submit">
            1
          </button>
          <button className="button2" type="submit">
            2
          </button>
          <button className="button3" type="submit">
            3
          </button>
        </div>
      </form>
    </div>
  );
}

export default App;
